DROP VIEW IF EXISTS `escuelas`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `escuelas` AS select `plan`.`des_escuela` AS `des_escuela`,`plan`.`ID` AS `ID` from `plan` group by `plan`.`des_escuela`;

-- ----------------------------
-- View structure for especialidades
-- ----------------------------
DROP VIEW IF EXISTS `especialidades`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `especialidades` AS select `plan`.`des_especialidad` AS `des_especialidad`,`plan`.`ID` AS `ID`,count(0) AS `count(0)` from `plan` group by `plan`.`des_especialidad`;

-- ----------------------------
-- View structure for planes
-- ----------------------------
DROP VIEW IF EXISTS `planes`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `planes` AS select `plan`.`des_plan` AS `des_plan`,`plan`.`ID` AS `ID` from `plan` group by `plan`.`des_plan`;

-- ----------------------------
-- View structure for planes_grupos
-- ----------------------------
DROP VIEW IF EXISTS `planes_grupos`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `planes_grupos` AS select `plan`.`ID` AS `ID`,count(0) AS `total`,`plan`.`cod_plan` AS `cod_plan`,`plan`.`des_escuela` AS `des_escuela`,`plan`.`des_plan` AS `des_plan`,`plan`.`des_especialidad` AS `des_especialidad`,`plan`.`des_asignatura` AS `des_asignatura` from `plan` group by `plan`.`des_escuela`,`plan`.`des_plan`,`plan`.`des_especialidad`,`plan`.`des_asignatura`;
